import React, { useState, useEffect } from 'react'
import styles from '../../src/myStyles.module.css'
import { useDispatch, useSelector } from 'react-redux'
import { createUrl, fetchUrl } from '../redux/action/urlAction';

function Url() {

    const [url, setUrl] = useState()

    const dispatch = useDispatch()

    useEffect(() => {
        dispatch(fetchUrl())
    }, [dispatch])

    const state = useSelector(state => state.url)
    console.log(state)
    const { urlInfo, urlDetails } = state
    console.log(urlInfo)
    console.log(urlDetails)

    const urlHandler = (e) => {
        e.preventDefault()
        const longUrl = {
            longUrl: url
        }
        dispatch(createUrl(longUrl))
        setUrl(" ")
    }
    return (
        <div>
            <form className={styles.userform}>
                <div className={styles.userlabel}>
                    <label>Enter Long URL:</label>
                    <input type="url" value={url} onChange={(e) => setUrl(e.target.value)} />
                </div>
                <div className={styles.userlabel}>
                    <button onClick={urlHandler}>Generate Short Url</button>
                </div>
            </form>
            <table className={styles.table}>
                <tr >
                    <th  className={styles.table}>Long Url</th>
                    <th  className={styles.table}>Short Url</th>
                </tr>

                {urlDetails && urlDetails.map(url => {
                    return (
                        <tr key={url.id}>
                            <td  className={styles.table}>{url.longUrl}</td>
                            <td  className={styles.table}>{url.urlCode}</td>
                        </tr>
                    )
                })}
            </table>

        </div>
    )
}

export default Url
